import Link from 'next/link'

import ReactLogo from '../assets/logo.svg';
<ReactLogo className={styles.Layout_logo} alt="logo"  />

const Navbar = () => (

    <div>
        <Link href="/"><a>Home</a></Link>
        <Link href="/about"><a>About</a></Link>
    </div>
)

export default Navbar
